import { Container, Carousel, Row } from "react-bootstrap";
import logo from './img/logo.svg';

const Home = () => {
    return (
        <Container>
            <Row>
            <Carousel cols={2} rows={1} gap={10} loop>
                <Carousel.Item>
                    <img width="100%" src="https://picsum.photos/800/600?random=1" alt=""/>
                </Carousel.Item>
                <Carousel.Item>
                    <img width="100%" src="https://picsum.photos/800/600?random=2" alt="" />
                </Carousel.Item>
                <Carousel.Item>
                    <img width="100%" src="https://picsum.photos/800/600?random=3" alt=""/>
                </Carousel.Item>
                <Carousel.Item>
                    {/* anything you want to show in the grid */}
                </Carousel.Item>
                {/* ... */}
            </Carousel>
            </Row>
        </Container>
    );
}

export default Home;
